import React from "react";

import { Link } from "react-router-dom";

import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

import { Button } from "react-mdl";

import printer from "../assets/print-24px.svg";
import computer from "../assets/desktop_windows-24px.svg";

import "./home.css";

const containerStyle = {
  width: "100%",
  height: "88vh"
};
const colStyle = {
  height: "88vh",
  width: "50vw",
  align: "center",
  justifyContent: "center",
  marginRight: 5
};
const Logo = {
  height: "30vh",
  width: "30vh",
  justifyContent: "center",
  align: "center"
};
const headerStyle = {
  color: "#000",
  fontSize: 56,
  fontWeight: "bold",
  justifyContent: "center",
  align: "center"
};
const paragraphStyle = {
  color: "#808080",
  fontSize: 24,
  marginRight: 50,
  marginLeft: 50
};
const buttonStyle = {
  float: "right",
  marginRight: "10px",
  backgroundColor: "#990000",
  color: "#fff",
  fontSize: 18,
  fontWeight: "bold"
};

export class home extends React.Component {
  render() {
    return (
      <Container fluid="true" style={containerStyle}>
        <Row>
          <Col className="left" id="printer" style={colStyle}>
            <Link to="/WEPASupport">
              <div>
                <h1 className="centeredText" id="10" style={headerStyle}>
                  Printer Support
                </h1>
                <img
                  src={printer}
                  style={Logo}
                  className="centeredIcon"
                  id="printerIcon"
                ></img>
                <p className="centeredText" id="11" style={paragraphStyle}>
                  If you need help with using the WEPA printers or believe there
                  is a problem, please click here.
                </p>
              </div>
            </Link>
          </Col>
          <Col style={colStyle}>
            <Link to="/APUSupport">
              <div>
                <h1 className="centeredText" id="12" style={headerStyle}>
                  Computer Support
                </h1>
                <img
                  src={computer}
                  style={Logo}
                  className="centeredIcon"
                  id="computerIcon"
                ></img>
                <p className="centeredText" id="13" style={paragraphStyle}>
                  If you need help with any of the lab computers or you are
                  having APU account difficulties, please click here.
                </p>
              </div>
            </Link>
          </Col>
        </Row>
        <Row>
          <Col md={{ span: 4, offset: 8 }}>
            <Link to="/passwordReset">
              <Button raised style={buttonStyle}>
                Reset Password
              </Button>
            </Link>
          </Col>
        </Row>
      </Container>
    );
  }
}

export default home;
